import { Component } from "react";

class CardList extends Component {
  render() {

    const { hosts } = this.props

    return(
        <div>
            {hosts.map(eachHost =>(
                <h1 key={eachHost.id} > {eachHost.name}</h1>
            ))}
        </div>  
    ) 
  }
}

export default CardList;
